CREATE DEFINER=`root`@`localhost` PROCEDURE `GrodownWiseCalProcedure` (IN `productID` INT, IN `godownID` INT, IN `from_date` DATE, IN `to_date` DATE, IN `voucher_type_id` INT, IN `voucher_id` INT)   BEGIN
   SELECT
        CAST(final.current_qty  as Int) as current_qty,
        CAST(final.current_rate as Double) as current_rate,
        final.inwards_qty,
        final.outwards_qty,
        final.inwards_value,
        final.outwards_value,
        final.invoice_no,
        final.tran_id,
        final.transaction_date,
        final.voucher_name,
        final.voucher_type_id,
        final.ledger_name,
        final.id
    FROM
        (
            SELECT
                tmp.product_id,
                tmp.inwards_qty,
                tmp.outwards_qty,
                tmp.inwards_value,
                tmp.outwards_value,
                tmp.invoice_no,
                tmp.tran_id,
                tmp.transaction_date,
                tmp.voucher_name,
                tmp.voucher_type_id,
                tmp.ledger_name,
                tmp.id,
                CASE
                    WHEN tmp.inwards_qty != 0 THEN
                        (@total_rate := ((@total_rate * @total_quant) + tmp.inwards_value) / (@total_quant + tmp.inwards_qty))
                    ELSE @total_rate
                END AS current_rate,
                CASE
                    WHEN tmp.inwards_qty != 0 THEN
                        (@total_quant := @total_quant + tmp.inwards_qty)
                    ELSE
                        (@total_quant := @total_quant - tmp.outwards_qty)
                END AS current_qty
            FROM
                (
                    SELECT
                        stock_item_id AS product_id,
                        id AS id,
                        inwards_qty,
                        outwards_qty,
                        inwards_value,
                        transaction_master.invoice_no,
                        transaction_master.tran_id,
                        transaction_master.transaction_date,
                        voucher_setup.voucher_name,
                        voucher_setup.voucher_type_id,
                        ledger_head.ledger_name,
                        outwards_value
                    FROM transaction_master
                    INNER JOIN    stock
                    ON         transaction_master.tran_id=stock.tran_id
                    INNER JOIN (SELECT  debit_credit.ledger_head_id,debit_credit.tran_id  FROM debit_credit GROUP BY debit_credit.tran_id ) AS debit_credit
                               ON         transaction_master.tran_id=debit_credit.tran_id
                    INNER JOIN ledger_head
                    ON         ledger_head.ledger_head_id=debit_credit.ledger_head_id
                    LEFT JOIN  voucher_setup
                    ON         transaction_master.voucher_id=voucher_setup.voucher_id
                    WHERE
                        stock.stock_item_id=productID AND stock.godown_id=godownID
                     AND    transaction_master.transaction_date BETWEEN from_date AND   to_date
                    AND (
                        (voucher_type_id = 0)
                        OR (voucher_type_id = 1 AND transaction_master.voucher_id = voucher_id)
                        OR (voucher_type_id = 2 AND voucher_setup.voucher_type_id = voucher_id)
                     )   
                     
                ) tmp
            CROSS JOIN (SELECT @total_quant := 0, @total_val := 0, @total_rate := 0) r
        ) final
   ;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ledger_head_opening_blance` (IN `new_group_id` INT, IN `new_DrCr` VARCHAR(2), IN `new_opening_balance` DECIMAL(10,2), IN `new_ledger_head_id` INT)   BEGIN
    DECLARE nature_group INT;
    
    SELECT group_chart.nature_group INTO nature_group
    FROM group_chart
    WHERE group_chart.group_chart_id = new_group_id;

    IF nature_group IN (1, 3) AND new_DrCr='Cr' THEN
        UPDATE ledger_head
        SET opening_balance = -new_opening_balance
        WHERE ledger_head_id=new_ledger_head_id;
    ELSEIF nature_group IN (2, 4)  AND new_DrCr='Dr' THEN
        UPDATE ledger_head
        SET opening_balance=new_opening_balance
        WHERE ledger_head_id=new_ledger_head_id;
    END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `StockInDeleteProcedure` (IN `p_stock_item_id` INT, IN `p_stock_in_id` INT, IN `p_qty` INT, IN `p_total` DOUBLE)   BEGIN
    DECLARE latest_qty INT;
    DECLARE latest_rate DOUBLE;
    DECLARE current_id INT;
    -- Retrieve values from the latest row for the same stock_item_id
    SELECT current_qty, current_rate,id
    INTO latest_qty, latest_rate,current_id
    FROM stock
    WHERE stock_item_id =p_stock_item_id
    ORDER BY id DESC
    LIMIT 1;
    UPDATE stock
     SET  current_rate =(((latest_qty*latest_rate)-(p_total))/(latest_qty-(p_qty))),
              current_qty =(latest_qty- p_qty)
    WHERE id=current_id;
     DELETE FROM stock
    WHERE stock_item_id=p_stock_item_id AND inwards_id=p_stock_in_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `StockInInsetProcedure` (IN `p_stock_item_id` INT, IN `p_godown_id` INT, IN `p_stock_in_id` INT, IN `p_qty` INT, IN `p_total` DOUBLE, IN `p_status` INT, IN `p_tran_id` INT, IN `p_tran_date` DATE)   BEGIN
    DECLARE latest_qty INT;
    DECLARE latest_rate DOUBLE;

    -- Retrieve values from the latest row for the same stock_item_id
    SELECT current_qty, current_rate
    INTO latest_qty, latest_rate
    FROM stock
    WHERE stock_item_id =p_stock_item_id
    ORDER BY id DESC
    LIMIT 1;

    -- Check if the stock_item_id exists
    IF latest_qty IS NOT NULL AND latest_rate IS NOT NULL THEN
        -- Insert into the stock table
        VALUES (
            p_stock_item_id,
            p_godown_id,
            p_stock_in_id,
            p_qty,
            p_total,
            latest_qty + p_qty,
            CASE
                WHEN p_status=1 THEN 
                 (((latest_qty * latest_rate) + p_total) /                  (latest_qty + p_qty))
                ELSE latest_rate
            END
            ,
            p_tran_id,
            p_tran_date
            
        );
 ELSE
        -- Insert into the stock table
        VALUES (
            p_stock_item_id,
            p_godown_id,
            p_stock_in_id,
            p_qty,
            p_total,
            p_qty,
            (p_total/ p_qty),
            p_tran_id,
            p_tran_date
        );
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `StockInUpdateProcedure` (IN `p_stock_item_id` INT, IN `p_godown_id` INT, IN `p_stock_in_id` INT, IN `p_qty` INT, IN `p_total` DOUBLE, IN `p_tran_date` DATE, IN `old_qty` INT, IN `old_total` DOUBLE)   BEGIN
