CREATE DEFINER=`root`@`localhost` FUNCTION `GodownWiseRateCal` (`productID` INT(10), `godownID` INT(10)) RETURNS DOUBLE  BEGIN 
    DECLARE totalRate DOUBLE DEFAULT 0; 
    
    SELECT final.Balance_Stock_Rate INTO totalRate 
    FROM ( 
        SELECT tmp.product_id, tmp.inwards_qty, tmp.outwards_qty, tmp.val, tmp.id, 
            CASE 
                WHEN tmp.inwards_qty != 0 THEN (@total_rate := ((@total_rate * @total_quant) + tmp.val) / (@total_quant + tmp.inwards_qty)) 
                ELSE @total_rate 
            END AS Balance_Stock_Rate, 
            CASE 
                WHEN tmp.inwards_qty != 0 THEN (@total_quant := @total_quant + tmp.inwards_qty) 
                ELSE (@total_quant := @total_quant - tmp.outwards_qty) 
            END AS Balance_Stock_Quantity 
        FROM ( 
            SELECT stock_item_id AS product_id, id AS id, inwards_qty, outwards_qty, inwards_value AS val 
            FROM stock 
            WHERE stock_item_id = productID AND godown_id = godownID 
        ) tmp 
        CROSS JOIN (SELECT @total_quant := 0, @total_val := 0, @total_rate := 0) r 
    ) final 
    ORDER BY id DESC 
    LIMIT 1; 
    
    RETURN totalRate; 
END$$

